class Solution:
    def maxOperations(self, s: str) -> int:
        n = len(s)

        s = list(s)
        print(s)

        prefix =[0]*(n)
        cnt_left =0

        for i in range(n):
            if s[i]=="1":
                cnt_left += 1
                prefix[i] = prefix[i-1]
            if s[i]=="0":

                if cnt_left>0:
                    prefix[i] = prefix[i-1]+cnt_left
                    cnt_left =0 
                else:
                    prefix[i] = prefix[i-1]
                    cnt_left =0 

        print(prefix)

        st = set(prefix)
        arr = list(st)
        print(arr)
        summ=0
        for x in arr:
            summ+=x

        return summ
